static int
function_keyword_cmp (const void *f1, const void *f2)
{
  return strcasecmp (((FUNCTION_MAP *) f1)->keyword,
		     ((FUNCTION_MAP *) f2)->keyword);
}



FUNCTION_MAP *
keyword_offset (const char *text)
{
  static bool function_keyword_sorted = false;
  FUNCTION_MAP dummy;
  FUNCTION_MAP *result_key;

  if (function_keyword_sorted == false)
    {
      qsort (functions,
	     (sizeof (functions) / sizeof (functions[0])),
	     sizeof (functions[0]), function_keyword_cmp);

      function_keyword_sorted = true;
    }

  if (!text)
    {
      return NULL;
    }

  if (strlen (text) >= MAX_KEYWORD_SIZE)
    {
      return NULL;
    }

  dummy.keyword = text;

  result_key =
    (FUNCTION_MAP *) bsearch (&dummy, functions,
			      (sizeof (functions) / sizeof (functions[0])),
			      sizeof (FUNCTION_MAP), function_keyword_cmp);

  return result_key;
}


PT_NODE *
parser_keyword_func (const char *name, PT_NODE * args)
{
  PT_NODE *node;
  PT_NODE *top_node;
  PT_NODE *a1, *a2, *a3;
  FUNCTION_MAP *key;
  int c;

  parser_function_code = PT_EMPTY;
  c = parser_count_list (args);
  key = keyword_offset (name);
  if (key == NULL)
    return NULL;

  parser_function_code = key->op;

  a1 = a2 = a3 = NULL;
  switch (key->op)
    {
      /* arg 0 */
    case PT_PI:
    case PT_SYS_TIME:
    case PT_SYS_DATE:
    case PT_SYS_DATETIME:
    case PT_SYS_TIMESTAMP:
    case PT_UTC_TIME:
    case PT_UTC_DATE:
    case PT_VERSION:
      if (c != 0)
	{
	  return NULL;
	}
      return parser_make_expression (key->op, NULL, NULL, NULL);

    case PT_ROW_COUNT:
    case PT_LAST_INSERT_ID:
      if (c != 0)
	{
	  return NULL;
	}
      parser_cannot_cache = true;
      parser_cannot_prepare = true;
      return parser_make_expression (key->op, NULL, NULL, NULL);

      /* arg 0 or 1 */
    case PT_RAND:
    case PT_RANDOM:
    case PT_DRAND:
    case PT_DRANDOM:
      {
	PT_NODE *expr;
	parser_cannot_cache = true;

	if (c < 0 || c > 1)
	  {
	    return NULL;
	  }

	if (c == 1)
	  {
	    a1 = args;
	  }
	expr = parser_make_expression (key->op, a1, NULL, NULL);
	expr->do_not_fold = 1;
	return expr;
      }

      /* arg 1 */
    case PT_ABS:
    case PT_BIN:
    case PT_CEIL:
    case PT_CHAR_LENGTH:	/* char_length, length, lengthb */
    case PT_CHR:
    case PT_EXP:
    case PT_FLOOR:
    case PT_LAST_DAY:
    case PT_SIGN:
    case PT_SQRT:
    case PT_ACOS:
    case PT_ASIN:
    case PT_COS:
    case PT_SIN:
    case PT_TAN:
    case PT_COT:
    case PT_DEGREES:
    case PT_RADIANS:
    case PT_LN:
    case PT_LOG2:
    case PT_LOG10:
    case PT_TYPEOF:
    case PT_MD5:
    case PT_SPACE:
    case PT_DAYOFMONTH:
    case PT_WEEKDAY:
    case PT_DAYOFWEEK:
    case PT_DAYOFYEAR:
    case PT_TODAYS:
    case PT_FROMDAYS:
    case PT_TIMETOSEC:
    case PT_SECTOTIME:
    case PT_QUARTERF:
    case PT_EXEC_STATS:
    case PT_CURRENT_VALUE:
    case PT_HEX:
    case PT_ASCII:
      if (c != 1)
        {
	  return NULL;
	}
      a1 = args;
      return parser_make_expression (key->op, a1, NULL, NULL);

    case PT_UNIX_TIMESTAMP:
      if (c > 1)
	{
	  return NULL;
	}
      if (c == 1)
	{
	  a1 = args;
	  return parser_make_expression (key->op, a1, NULL, NULL);
	}
      else /* no arguments */
	{
	  return parser_make_expression (key->op, NULL, NULL, NULL);
	}

      /* arg 2 */
    case PT_LOG:
    case PT_MONTHS_BETWEEN:
    case PT_NVL:
    case PT_POWER:
    case PT_TIME_FORMAT:
    case PT_FORMAT:
    case PT_DATE_FORMAT:
    case PT_ATAN2:
    case PT_DATEDIFF:
    case PT_TIMEDIFF:
    case PT_REPEAT:
    case PT_MAKEDATE:
    case PT_ADDTIME:
    case PT_FINDINSET:
      if (c != 2)
	return NULL;
      a1 = args;
      a2 = a1->next;
      a1->next = NULL;
      return parser_make_expression (key->op, a1, a2, NULL);

    case PT_NEXT_VALUE:
      if (c == 1)
	{
	  a1 = args;

	  /* default value for the second argument is 1. */
	  a2 = parser_new_node (this_parser, PT_VALUE);
	  if (a2)
	    {
	      a2->type_enum = PT_TYPE_INTEGER;
	      a2->info.value.data_value.i = 1;
	    }

	  return parser_make_expression (key->op, a1, a2, NULL);
	}
      else if (c == 2)
	{
	  a1 = args;
	  a2 = a1->next;
	  a1->next = NULL;

	  return parser_make_expression (key->op, a1, a2, NULL);
	}
      else
	{
	  return NULL;
	}

    case PT_ATAN:
      if (c == 1)
	{
	  a1 = args;
	  return parser_make_expression (key->op, a1, NULL, NULL);
	}
      else if (c == 2)
	{
	  a1 = args;
	  a2 = a1->next;
	  a1->next = NULL;
	  return parser_make_expression (PT_ATAN2, a1, a2, NULL);
	}
      else
	{
	  return NULL;
	}

      /* arg 3 */
    case PT_SUBSTRING_INDEX:
    case PT_NVL2:
    case PT_MAKETIME:
    case PT_INDEX_CARDINALITY:
    case PT_CONV:
      if (c != 3)
	return NULL;
      a1 = args;
      a2 = a1->next;
      a3 = a2->next;
      a1->next = a2->next = NULL;
      return parser_make_expression (key->op, a1, a2, a3);

      /* arg 1 + default */
    case PT_ROUND:
    case PT_TRUNC:
      if (c == 1)
	{
	  a1 = args;
	  a2 = parser_new_node (this_parser, PT_VALUE);
	  if (a2)
	    {
	      a2->type_enum = PT_TYPE_INTEGER;
	      a2->info.value.data_value.i = 0;
	    }

	  return parser_make_expression (key->op, a1, a2, NULL);
	}

      if (c != 2)
	return NULL;
      a1 = args;
      a2 = a1->next;
      a1->next = NULL;
      return parser_make_expression (key->op, a1, a2, NULL);

      /* arg 2 + default */
    case PT_INSTR:		/* instr, instrb */
      if (c == 2)
	{
	  a3 = parser_new_node (this_parser, PT_VALUE);
	  if (a3)
	    {
	      a3->type_enum = PT_TYPE_INTEGER;
	      a3->info.value.data_value.i = 1;
	    }

	  a1 = args;
	  a2 = a1->next;
	  a1->next = NULL;

	  return parser_make_expression (key->op, a1, a2, a3);
	}

      if (c != 3)
	return NULL;
      a1 = args;
      a2 = a1->next;
      a3 = a2->next;
      a1->next = a2->next = NULL;
      return parser_make_expression (key->op, a1, a2, a3);

      /* arg 1 or 2 */
    case PT_WEEKF:
      if (c < 1 || c > 2)
   	return NULL;
      if (c == 1)
	{
	  a1 = args;
	  a2 = parser_new_node (this_parser, PT_VALUE);
	  if (a2)
	   {
	     a2->info.value.data_value.i = PRM_DEFAULT_WEEK_FORMAT;
	     a2->type_enum = PT_TYPE_INTEGER;
	   }
	  return parser_make_expression (key->op, a1, a2, NULL);
	}
      else
	{
	  a1 = args;
	  a2 = a1->next;
	  a1->next = NULL;
	  return parser_make_expression (key->op, a1, a2, NULL);
	}

    case PT_LTRIM:
    case PT_RTRIM:
    case PT_LIKE_LOWER_BOUND:
    case PT_LIKE_UPPER_BOUND:
    case PT_FROM_UNIXTIME:
      if (c < 1 || c > 2)
	return NULL;
      a1 = args;
      if (a1)
	a2 = a1->next;
      a1->next = NULL;
      return parser_make_expression (key->op, a1, a2, a3);

      /* arg 1 or 2 */
    case PT_TO_NUMBER:
      if (c < 1 || c > 2)
	{
	  push_msg (MSGCAT_SYNTAX_INVALID_TO_NUMBER);
	  csql_yyerror_explicit (10, 10);
	  return NULL;
	}

      if (c == 2)
	{
	  PT_NODE *node = args->next;
	  if (node->node_type != PT_VALUE ||
	      (node->type_enum != PT_TYPE_CHAR &&
	       node->type_enum != PT_TYPE_NCHAR))
	    {
	      push_msg (MSGCAT_SYNTAX_INVALID_TO_NUMBER);
	      csql_yyerror_explicit (10, 10);
	      return NULL;
	    }
	}

      a1 = args;
      if (a1)
	a2 = a1->next;
      a1->next = NULL;
      return parser_make_expression (key->op, a1, a2, a3);

      /* arg 2 or 3 */
    case PT_LPAD:
    case PT_RPAD:
    case PT_SUBSTRING:		/* substr, substrb */

      if (c < 2 || c > 3)
	return NULL;

      a1 = args;
      a2 = a1->next;
      if (a2)
	{
	  a3 = a2->next;
	  a2->next = NULL;
	}

      a1->next = NULL;

      node = parser_make_expression (key->op, a1, a2, a3);
      if (key->op == PT_SUBSTRING)
	{
	  node->info.expr.qualifier = PT_SUBSTR;
	  PICE (node);
	}

      return node;

    case PT_ORDERBY_NUM:
      if (c != 0)
	return NULL;

      node = parser_new_node (this_parser, PT_EXPR);
      if (node)
	{
	  node->info.expr.op = PT_ORDERBY_NUM;
	  PT_EXPR_INFO_SET_FLAG (node, PT_EXPR_INFO_ORDERBYNUM_C);
	}

      if (parser_orderbynum_check == 0)
	PT_ERRORmf2 (this_parser, node, MSGCAT_SET_PARSER_SEMANTIC,
		     MSGCAT_SEMANTIC_INSTNUM_COMPATIBILITY_ERR,
		     "ORDERBY_NUM()", "ORDERBY_NUM()");

      parser_groupby_exception = PT_ORDERBY_NUM;
      return node;

    case PT_INST_NUM:
      if (c != 0)
	return NULL;

      node = parser_new_node (this_parser, PT_EXPR);

      if (node)
	{
	  node->info.expr.op = PT_INST_NUM;
	  PT_EXPR_INFO_SET_FLAG (node, PT_EXPR_INFO_INSTNUM_C);
	}

      if (parser_instnum_check == 0)
	PT_ERRORmf2 (this_parser, node, MSGCAT_SET_PARSER_SEMANTIC,
		     MSGCAT_SEMANTIC_INSTNUM_COMPATIBILITY_ERR,
		     "INST_NUM() or ROWNUM", "INST_NUM() or ROWNUM");

      parser_groupby_exception = PT_INST_NUM;
      return node;

    case PT_INCR:
    case PT_DECR:
      if (c != 1)
	return NULL;
      node = parser_make_expression (key->op, args, NULL, NULL);

      if ((args->node_type != PT_NAME && args->node_type != PT_DOT_) ||
	  (args->node_type == PT_NAME && args->info.name.tag_click_counter) ||
	  (args->node_type == PT_DOT_ && args->info.dot.tag_click_counter))
	{
	  PT_ERRORf (this_parser, node,
		     "%s argument must be identifier or dotted identifier(path expression)",
		     pt_short_print (this_parser, node));
	}

      if (parser_select_level != 1)
	{
	  PT_ERRORf (this_parser, node,
		     "%s can be used at top select statement only.",
		     pt_short_print (this_parser, node));
	}
      node->is_hidden_column = 1;
      parser_hidden_incr_list =
	parser_append_node (node, parser_hidden_incr_list);
      if ((a1 = parser_copy_tree (this_parser, node->info.expr.arg1)) == NULL)
	{
	  return NULL;
	}

      parser_cannot_cache = true;

      if (a1->node_type == PT_NAME)
	a1->info.name.tag_click_counter = 1;
      else if (a1->node_type == PT_DOT_)
	a1->info.dot.tag_click_counter = 1;

      top_node = parser_top_select_stmt_node (); 
      if (top_node) 
      {
	  top_node->is_click_counter = 1;
      }

      return a1;

    case PT_TO_CHAR:
    case PT_TO_DATE:
    case PT_TO_TIME:
    case PT_TO_TIMESTAMP:
    case PT_TO_DATETIME:
      if (c < 1 || c > 3)
	return NULL;
      a1 = args;
      a2 = a1->next;
      a1->next = NULL;

      if (a2)
	{
	  a3 = a2->next;
	}

      if (a2)
	{
	  a2->next = NULL;
	}

      if (c == 1)
	{
	  a2 = parser_new_node (this_parser, PT_VALUE);

	  if (a2)
	    {
	      a2->type_enum = PT_TYPE_NULL;
	    }
	}

      return parser_make_expression (key->op, a1, a2,
				     parser_make_date_lang (c, a3));

    case PT_BIT_TO_BLOB:
    case PT_CHAR_TO_BLOB:
    case PT_CHAR_TO_CLOB:
    case PT_BLOB_LENGTH:
    case PT_CLOB_LENGTH:
      if (c != 1)
	{
	  return NULL;
	}

      a1 = args;
      /*
         a2 = parser_new_node (this_parser, PT_VALUE);
         if (a2)
         {
         if (key->op == PT_BIT_TO_BLOB ||
         key->op == PT_CHAR_TO_BLOB)
         {
         a2->type_enum = PT_TYPE_BLOB;
         }
         else if (key->op == PT_CHAR_TO_CLOB)
         {
         a2->type_enum = PT_TYPE_CLOB;
         }
         else if (key->op == PT_BLOB_LENGTH ||
         key->op == PT_CLOB_LENGTH)
         {
         a2->type_enum = PT_TYPE_BIGINT;
         }
         }
       */
      return parser_make_expression (key->op, a1, NULL, NULL);

    case PT_BLOB_TO_BIT:
    case PT_CLOB_TO_CHAR:
      if (c != 1 && c != 2)
	{
	  return NULL;
	}

      a1 = args;
      if (c == 2)
	/*
	   {
	   a2 = parser_new_node (this_parser, PT_VALUE);
	   if (a2)
	   {
	   if (key->op == PT_BLOB_TO_BIT)
	   {
	   a2->type_enum = PT_TYPE_VARBIT;
	   }
	   else if (key->op == PT_CLOB_FROM_FILE)
	   { 
	   a2->type_enum = PT_TYPE_VARCHAR;
	   }
	   }
	   }
	   else
	 */
	{
	  a2 = a1->next;
	  a1->next = NULL;
	}
      return parser_make_expression (key->op, a1, a2, NULL);

    case PT_BLOB_FROM_FILE:
    case PT_CLOB_FROM_FILE:
      if (c != 1)
	{
	  return NULL;
	}
      else
	{
	  PT_NODE *node;

	  a1 = args;
	  a2 = parser_new_node (this_parser, PT_VALUE);
	  if (a2)
	    {
	      if (key->op == PT_BLOB_FROM_FILE)
		{
		  a2->type_enum = PT_TYPE_BLOB;
		}
	      else if (key->op == PT_CLOB_FROM_FILE)
		{
		  a2->type_enum = PT_TYPE_CLOB;
		}
	    }

	  /* Those two functions should be evaluated at the compile time */
	  parser_cannot_cache = true;
	  parser_cannot_prepare = true;
	  node = parser_make_expression (key->op, a1, a2, NULL);

	  if (a1->node_type != PT_VALUE || a1->type_enum != PT_TYPE_CHAR)
	    {
	      PT_ERRORf (this_parser, node,
			 "%s argument must be a string liternal",
			 pt_short_print (this_parser, node));
	      return NULL;
	    }
	  return node;
	}

    case PT_DECODE:
      {
	int i;
	PT_NODE *case_oper, *ppp, *qqq, *rrr, *nodep, *node, *curr, *prev;
	int count;

	if (c < 3)
	  return NULL;

	case_oper = args;
	ppp = args->next;
	args->next = NULL;
	curr = ppp->next;
	ppp->next = NULL;

	node = parser_new_node (this_parser, PT_EXPR);
	if (node)
	  {
	    node->info.expr.op = PT_DECODE;
	    qqq = parser_new_node (this_parser, PT_EXPR);
	    if (qqq)
	      {
		qqq->info.expr.op = PT_EQ;
		qqq->info.expr.qualifier = PT_EQ_TORDER;
		qqq->info.expr.arg1 =
		  parser_copy_tree_list (this_parser, case_oper);
		qqq->info.expr.arg2 = ppp;
		node->info.expr.arg3 = qqq;
		PICE (qqq);
	      }

	    ppp = curr->next;
	    curr->next = NULL;
	    node->info.expr.arg1 = curr;
	    PICE (node);
	  }

	prev = node;
	count = parser_count_list (ppp);
	for (i = 1; i <= count; i++)
	  {
	    if (i % 2 == 0)
	      {
		rrr = ppp->next;
		ppp->next = NULL;
		nodep = parser_new_node (this_parser, PT_EXPR);
		if (nodep)
		  {
		    nodep->info.expr.op = PT_DECODE;
		    qqq = parser_new_node (this_parser, PT_EXPR);
		    if (qqq)
		      {
			qqq->info.expr.op = PT_EQ;
			qqq->info.expr.qualifier = PT_EQ_TORDER;
			qqq->info.expr.arg1 =
			  parser_copy_tree_list (this_parser, case_oper);
			qqq->info.expr.arg2 = ppp;
			nodep->info.expr.arg3 = qqq;
			PICE (nodep);
		      }
		    nodep->info.expr.arg1 = rrr;
		    nodep->info.expr.continued_case = 1;
		  }
		PICE (nodep);

		if (prev)
		  prev->info.expr.arg2 = nodep;
		PICE (prev);
		prev = nodep;

		ppp = rrr->next;
		rrr->next = NULL;
	      }
	  }

	/* default value */
	if (i % 2 == 0)
	  {
	    if (prev)
	      prev->info.expr.arg2 = ppp;
	    PICE (prev);
	  }
	else if (prev && prev->info.expr.arg2 == NULL)
	  {
	    ppp = parser_new_node (this_parser, PT_VALUE);
	    if (ppp)
	      ppp->type_enum = PT_TYPE_NULL;
	    prev->info.expr.arg2 = ppp;
	    PICE (prev);
	  }

	if (case_oper)
	  parser_free_node (this_parser, case_oper);

	return node;
      }

    case PT_LEAST:
    case PT_GREATEST:
      {
	PT_NODE *prev, *expr, *arg, *tmp;
	int i;
	arg = args;

	if (c < 1)
	  return NULL;

	expr = parser_new_node (this_parser, PT_EXPR);
	if (expr)
	  {
	    expr->info.expr.op = key->op;
	    expr->info.expr.arg1 = arg;
	    expr->info.expr.arg2 = NULL;
	    expr->info.expr.arg3 = NULL;
	    expr->info.expr.continued_case = 1;
	  }

	PICE (expr);
	prev = expr;

	if (c > 1)
	  {
	    tmp = arg;
	    arg = arg->next;
	    tmp->next = NULL;

	    if (prev)
	      prev->info.expr.arg2 = arg;
	    PICE (prev);
	  }
	for (i = 3; i <= c; i++)
	  {
	    tmp = arg;
	    arg = arg->next;
	    tmp->next = NULL;

	    expr = parser_new_node (this_parser, PT_EXPR);
	    if (expr)
	      {
		expr->info.expr.op = key->op;
		expr->info.expr.arg1 = prev;
		expr->info.expr.arg2 = arg;
		expr->info.expr.arg3 = NULL;
		expr->info.expr.continued_case = 1;
	      }

	    if (prev && prev->info.expr.continued_case >= 1)
	      prev->info.expr.continued_case++;
	    PICE (expr);
	    prev = expr;
	  }

	if (expr && expr->info.expr.arg2 == NULL)
	  {
	    expr->info.expr.arg2 =
	      parser_copy_tree_list (this_parser, expr->info.expr.arg1);
	    expr->info.expr.arg2->is_hidden_column = 1;
	  }

	return expr;
      }

    case PT_CONCAT:
    case PT_CONCAT_WS:
    case PT_FIELD:
      {
	PT_NODE *prev, *expr, *arg, *tmp, *sep, *val;
	int i, ws;
	arg = args;

	ws = (key->op != PT_CONCAT) ? 1 : 0;
	if (c < 1 + ws)
	  return NULL;

	if (key->op != PT_CONCAT)
	  {
	    sep = arg;
	    arg = arg->next;
	  }
	else
	  {
	    sep = NULL;
	  }

	expr = parser_new_node (this_parser, PT_EXPR);
	if (expr)
	  {
	    expr->info.expr.op = key->op;
	    expr->info.expr.arg1 = arg;
	    expr->info.expr.arg2 = NULL;
	    if (key->op == PT_FIELD && sep)
	      {
		val = parser_new_node (this_parser, PT_VALUE);
		if (val)
		  {
		    val->type_enum = PT_TYPE_INTEGER;
		    val->info.value.data_value.i = 1;
		    val->is_hidden_column = 1;
		  }
		expr->info.expr.arg3 = parser_copy_tree (this_parser, sep);
		expr->info.expr.arg3->next = val;
	      }
	    else
	      {
		expr->info.expr.arg3 = sep;
	      }
	    expr->info.expr.continued_case = 1;
	  }

	PICE (expr);
	prev = expr;

	if (c > 1 + ws)
	  {
	    tmp = arg;
	    arg = arg->next;
	    tmp->next = NULL;

	    if (prev)
	      prev->info.expr.arg2 = arg;
	    PICE (prev);
	  }
	for (i = 3 + ws; i <= c; i++)
	  {
	    tmp = arg;
	    arg = arg->next;
	    tmp->next = NULL;

	    expr = parser_new_node (this_parser, PT_EXPR);
	    if (expr)
	      {
		expr->info.expr.op = key->op;
		expr->info.expr.arg1 = prev;
		expr->info.expr.arg2 = arg;
		if (sep)
		  {
		    expr->info.expr.arg3 =
		      parser_copy_tree (this_parser, sep);
		    if (key->op == PT_FIELD)
		      {
			val = parser_new_node (this_parser, PT_VALUE);
			if (val)
			  {
			    val->type_enum = PT_TYPE_INTEGER;
			    val->info.value.data_value.i = i - ws;
			    val->is_hidden_column = 1;
			  }
			expr->info.expr.arg3->next = val;
		      }
		  }
		else
		  {
		    expr->info.expr.arg3 = NULL;
		  }
		expr->info.expr.continued_case = 1;
	      }

	    if (prev && prev->info.expr.continued_case >= 1)
	      prev->info.expr.continued_case++;
	    PICE (expr);
	    prev = expr;
	  }

	if (key->op == PT_FIELD && expr && expr->info.expr.arg2 == NULL)
	  {
	    val = parser_new_node (this_parser, PT_VALUE);
	    if (val)
	      {
		val->type_enum = PT_TYPE_NULL;
		val->is_hidden_column = 1;
	      }
	    expr->info.expr.arg2 = val;
	  }

	return expr;
      }

    case PT_LOCATE:
      if (c < 2 || c > 3)
	return NULL;

      a1 = args;
      a2 = a1->next;
      if (a2)
	{
	  a3 = a2->next;
	  a2->next = NULL;
	}
      a1->next = NULL;

      node = parser_make_expression (key->op, a1, a2, a3);
      return node;

    case PT_MID:
      if (c != 3)
	return NULL;

      a1 = args;
      a2 = a1->next;
      a3 = a2->next;
      a1->next = NULL;
      a2->next = NULL;
      a3->next = NULL;

      node = parser_make_expression (key->op, a1, a2, a3);
      return node;

    case PT_STRCMP:
      if (c != 2)
	return NULL;

      a1 = args;
      a2 = a1->next;
      a1->next = NULL;

      node = parser_make_expression (key->op, a1, a2, a3);
      return node;

    case PT_REVERSE:
      if (c != 1)
	return NULL;

      a1 = args;
      node = parser_make_expression (key->op, a1, NULL, NULL);
      return node;

    case PT_BIT_COUNT:
      if (c != 1)
	return NULL;

      a1 = args;
      node = parser_make_expression (key->op, a1, NULL, NULL);
      return node;

    case PT_GROUPBY_NUM:
      if (c != 0)
	return NULL;

      node = parser_new_node (this_parser, PT_FUNCTION);

      if (node)
	{
	  node->info.function.function_type = PT_GROUPBY_NUM;
	  node->info.function.arg_list = NULL;
	  node->info.function.all_or_distinct = PT_ALL;
	}

      if (parser_groupbynum_check == 0)
	PT_ERRORmf2 (this_parser, node, MSGCAT_SET_PARSER_SEMANTIC,
		     MSGCAT_SEMANTIC_INSTNUM_COMPATIBILITY_ERR,
		     "GROUPBY_NUM()", "GROUPBY_NUM()");
      return node;

    case PT_LIST_DBS:
      if (c != 0)
	return NULL;
      node = parser_make_expression (key->op, NULL, NULL, NULL);
      return node;

    default:
      return NULL;
    }

  return NULL;
}


static void
resolve_alias_in_expr_node (PT_NODE * node, PT_NODE * list)
{
  if (!node)
    {
      return;
    }

  switch (node->node_type)
    {
    case PT_SORT_SPEC:
      if (node->info.sort_spec.expr
	  && node->info.sort_spec.expr->node_type == PT_NAME)
	{
	  resolve_alias_in_name_node (&node->info.sort_spec.expr, list);
	}
      else
	{
	  resolve_alias_in_expr_node (node->info.sort_spec.expr, list);
	}
      break;

    case PT_EXPR:
      if (node->info.expr.arg1 && node->info.expr.arg1->node_type == PT_NAME)
	{
	  resolve_alias_in_name_node (&node->info.expr.arg1, list);
	}
      else
	{
	  resolve_alias_in_expr_node (node->info.expr.arg1, list);
	}
      if (node->info.expr.arg2 && node->info.expr.arg2->node_type == PT_NAME)
	{
	  resolve_alias_in_name_node (&node->info.expr.arg2, list);
	}
      else
	{
	  resolve_alias_in_expr_node (node->info.expr.arg2, list);
	}
      if (node->info.expr.arg3 && node->info.expr.arg3->node_type == PT_NAME)
	{
	  resolve_alias_in_name_node (&node->info.expr.arg3, list);
	}
      else
	{
	  resolve_alias_in_expr_node (node->info.expr.arg3, list);
	}
      break;

    default:;
    }
}


static void
resolve_alias_in_name_node (PT_NODE ** node, PT_NODE * list)
{
  PT_NODE *col;
  char *n_str, *c_str;
  bool resolved = false;

  n_str = parser_print_tree (this_parser, *node);

  for (col = list; col; col = col->next)
    {
      if (col->node_type == PT_NAME)
	{
	  c_str = parser_print_tree (this_parser, col);
	  if (c_str == NULL)
	    {
	      continue;
	    }

	  if (intl_identifier_casecmp (n_str, c_str) == 0)
	    {
	      resolved = true;
	      break;
	    }
	}
    }

  if (resolved != true)
    {
      for (col = list; col; col = col->next)
	{
	  if (col->alias_print
	      && intl_identifier_casecmp (n_str, col->alias_print) == 0)
	    {
	      parser_free_node (this_parser, *node);
	      *node = parser_copy_tree (this_parser, col);
	      (*node)->next = NULL;
	      break;
	    }
	}
    }
}


